  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:27.451475\",\n\t\"name\": \"survey-for-contaminants-in-sediments-at-selected-sites-on-the-upper-mississippi-river-incl\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A regional study of contaminants in sediments
  at selected locations on the Upper Mississippi River was conducted during the 1989
  field season. The study focused primarily on areas within and adjacent to the Mark
  Twain National Wildlife Refuge (NWR), the Clarence Cannon NWR, other areas of critical
  importance to migratory waterfowl, and selected industrial sites at various locations
  throughout the basin. Bed sediments were collected at pre-designated sampling locations.
  Chemical analysis and fathead minnow bioassays were performed on samples from each
  location. A comparison of the analyses has confirmed several critical areas of concern
  or \"hot spots\", throughout the study area.\",\n\t\"license_title\": \"License
